def games_played_by_user(username):
    u = User.objects.get(username=username)
    person = Person.objects.get(user=u)
    pat = Patient.objects.get(person=person)
    pat_gestures = list(Gesture.objects.filter(patient=pat))
    gamesplayed_for_user = [gp for gp in  GamePlayed.objects.all() if gp.gesture in pat_gestures]

    games_played_dic = {}
    for gp in gamesplayed_for_user:
        if gp.game.name not in games_played_dic:
            games_played_dic[gp.game.name] = [{"date" : gp.date,
                                               "points" : gp.points,
                                               "gesture_name" : gp.gesture.name,
                                               "repetitions" : gp.repetitions,
                                               "bad_gestures" : gp.bad_gestures}]
        else:
            games_played_dic[gp.game.name].append({"date" : gp.date,
                                               "points" : gp.points,
                                               "gesture_name" : gp.gesture.name,
                                               "repetitions" : gp.repetitions,
                                               "bad_gestures" : gp.bad_gestures})

    return games_played_dic


def get_gestures(username, data_for):

    u = User.objects.get(username=username)
    person = Person.objects.get(user=u)
    pat = Patient.objects.get(person=person)
    pat_gestures = list(Gesture.objects.filter(patient=pat))
    gamesplayed_for_user = [gp for gp in GamePlayed.objects.all() if gp.gesture in pat_gestures]

    gestures_dic = {}
    for gp in gamesplayed_for_user:
        if gp.gesture.name not in gestures_dic:
            gestures_dic[gp.gesture.name] = {str(gp.date): gp.repetitions}
        else:
            if str(gp.date) in gestures_dic[gp.gesture.name]:
                gestures_dic[gp.gesture.name][str(gp.date)] += gp.repetitions
            else:
                gestures_dic[gp.gesture.name][str(gp.date)] =  gp.repetitions

    if data_for == "chart":
        dic = {}
        for key in gestures_dic:
            # for sorting effects
            tmp = [(k, gestures_dic[key][k]) for k in gestures_dic[key]]
            tmp = sorted(tmp, key=lambda x: x[0])

            dic[key] = [ [e[0] for e in tmp] , [e[1] for e in tmp] ]
        gestures_dic = dic
    return gestures_dic



def patient_games_scores(username, data_for):

    u = User.objects.get(username=username)
    person = Person.objects.get(user=u)
    pat = Patient.objects.get(person=person)
    pat_gestures = list(Gesture.objects.filter(patient=pat))
    gamesplayed_for_user = [gp for gp in GamePlayed.objects.all() if gp.gesture in pat_gestures]

    games_dic = {}
    for gp in gamesplayed_for_user:
        if gp.game.name not in games_dic:
            games_dic[gp.game.name] = {str(gp.date): [gp.points, 1]}
        else:
            if str(gp.date) in games_dic[gp.game.name]:
                games_dic[gp.game.name][str(gp.date)][0] = games_dic[gp.game.name][str(gp.date)][0] + gp.points
                games_dic[gp.game.name][str(gp.date)][1] = games_dic[gp.game.name][str(gp.date)][1] + 1
            else:
                games_dic[gp.game.name][str(gp.date)] = [gp.points, 1]

    #calc averages
    for k in games_dic:
        for d in games_dic[k]:
            points = games_dic[k][d][0]
            n = games_dic[k][d][1]
            games_dic[k][d] = points/n

    # data for charts
    if data_for == "chart":
        dic = {}
        for key in games_dic:
            # for sorting effects
            tmp = [(k, games_dic[key][k]) for k in games_dic[key]]
            tmp = sorted(tmp, key=lambda x: x[0])

            dic[key] = [ [e[0] for e in tmp] , [e[1] for e in tmp] ]
        games_dic = dic

    return games_dic



