def get_patient_gesture_score_dates(username, gesture_name, patient="null"):

    if patient=="null":
        # get patient
        u = User.objects.get(username=username)
        person = Person.objects.get(user=u)
        pat = Patient.objects.get(person=person)

    else:
        pat = patient
    
    # get gesture
    gesture = Gesture.objects.get(patient=pat, name=gesture_name)

    dic ={}
    for game_played in GamePlayed.objects.all():
        if game_played.gesture == gesture:
            # if date is not in the dict
            if str(game_played.date) not in dic:
                dic[str(game_played.date)] = {'correct': (game_played.repetitions) , 'incorrect': game_played.bad_gestures}
            else:
                dic[str(game_played.date)]['correct'] += (game_played.repetitions)
                dic[str(game_played.date)]['incorrect'] += game_played.bad_gestures

    print(dic)
    ordered_dic = {}
    for key in sorted(dic):
        ordered_dic[key] = dic[key]

    print("l")
    return ordered_dic

